yle="text-align: left"><b style="color: rgb(255 , 255 , 255)"><font style="font-size: 100px">Businessplan</font></b></div><span style="color: rgb(255 , 255 , 255)"><div style="text-align: left"><br /></div></span></div></div></foreignObject><text x="325" y="72" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">&lt;div style="text-align: left"&gt;&lt;b style="color: rgb(255 , 255 , 255)"&gt;&lt;font style="font-size: 100px"&gt;Businessplan&lt;/font&gt;&lt;/b&gt;&lt;/div&gt;&lt;span style="color: rgb(255 , 255 , 255)"&gt;&lt;div style="text-align: left"&gt;&lt;br&gt;&lt;/div&gt;&lt;/span&gt;</text></switch></g><g transform="translate(1839.5,3406.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="282" height="229" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 282px; width: 282px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 100%"></p><h1><font color="#ffffff" style="font-size: 36px">Product</font></h1><p><font color="#ffffff" style="font-size: 30px">Innovative Imitation</font></p><p style="text-align: left"><font style="font-size: 14px"><font color="#ffffff">We create value by adding innovative elements to our product/service compared to existing products/services. The customers perceive our offering as being more innovative and having something extra that delivers added value</font><span style="color: rgb(255 , 255 , 255) ; text-align: justify">.</span></font></p><p></p></div></div></foreignObject><text x="141" y="121" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(1839.5,3666.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="134" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 140px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Market</font></h1><p><font color="#ffffff" style="font-size: 14px">We deliver our product/service at market price. The customers will perceive our price as neither high now low, but close to the normal level in the market.</font></p></div></div></foreignObject><text x="136" y="73" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(1839.5,3816.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="118" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 150px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Productivity</font></h1><p><font color="#ffffff" style="font-size: 14px">We improve our customers' productivity. By using our product/service our customers can do certain things more efficiently.</font></p></div></div></foreignObject><text x="136" y="65" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(1844.5,3966.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="134" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 220px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Value Use</font></h1><p><font color="#ffffff"><font style="font-size: 14px">The most important customer value is created when using the product/service. Our value creation is focused on the actual use of the product or service.</font><br /></font></p></div></div></foreignObject><text x="136" y="73" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2176.5,3406.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="282" height="229" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 282px; width: 282px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 100%"></p><h1><font color="#ffffff" style="font-size: 36px">Configuration</font></h1><p><font color="#ffffff" style="font-size: 30px">Innovation</font></p><p><font color="#ffffff" style="font-size: 14px">Our most important capability is being innovative. We are able to develop highly innovative products and services because of our highly skilled staff, an innovative business culture and all the necessary technology.</font></p><p></p></div></div></foreignObject><text x="141" y="121" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2176.5,3666.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="150" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 190px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 120%"></p><h1><font color="#ffffff">Value Chain</font></h1><p><font style="font-size: 14px"><font color="#ffffff">We are a trusted partner in a highly integrated</font><span style="color: rgb(255 , 255 , 255)">value chain. We focus on adding value in a very</span><span style="color: rgb(255 , 255 , 255)">specific part of that value chain. The end-user may</span><span style="color: rgb(255 , 255 , 255)">never even hear about us.</span></font></p><p></p></div></div></foreignObject><text x="136" y="81" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2176.5,3846.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="198" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Value Network</font></h1><p><font style="font-size: 14px"><font color="#ffffff">We are the hosts or the link. 'Let us introduce you</font><span style="color: rgb(255 , 255 , 255)">to ...'. Our processes: 1. Network promotion and</span><span style="color: rgb(255 , 255 , 255)">contacts with members 2. Service provisioning -</span><span style="color: rgb(255 , 255 , 255)">establishing, maintaining and terminating links</span><span style="color: rgb(255 , 255 , 255)">between members 3. Network infrastructure - make</span><span style="color: rgb(255 , 255 , 255)">sure that network members communicate.</span></font></p></div></div></foreignObject><text x="136" y="105" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2538.5,3403.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="282" height="193" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 282px; width: 282px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 100%"></p><h1><font color="#ffffff" style="font-size: 36px">Financial</font></h1><p><font color="#ffffff" style="font-size: 30px">Bargaining</font></p><p><font style="font-size: 13px"><font color="#ffffff">Our prices are the result of individual negotiation</font><span style="color: rgb(255 , 255 , 255)">with each customer. The price is basically</span><span style="color: rgb(255 , 255 , 255)">dependent on our relationship with the buyer.</span></font></p></div></div></foreignObject><text x="141" y="103" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2538.5,3663.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="306" height="115" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 203px; max-width: 306px; width: 306px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Customer Characteristics</font></h1><p><font style="font-size: 13px"><font color="#ffffff">The prices depend on customer characteristics.</font><span style="color: rgb(255 , 255 , 255)">Some customers pay more than others. B</span><span style="color: rgb(255 , 255 , 255)">igger company = higher</span><span style="color: rgb(255 , 255 , 255)">price.</span></font></p></div></div></foreignObject><text x="153" y="64" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2538.5,3852.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="100" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 133px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Renting/Leasing</font></h1><p><font style="font-size: 13px"><font color="#ffffff">We rent or lease something to our customers for a</font><span style="color: rgb(255 , 255 , 255)">period of time, for which we charge a fee.</span></font></p></div></div></foreignObject><text x="136" y="56" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2538.5,3997.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="130" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 139px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Subscription</font></h1><p><span style="color: rgb(255 , 255 , 255)"><font style="font-size: 13px">People subscribe to out product/service. Over a certain period of time they get: 1. A fixed set of goods or services, or 2. Unlimited use of a service or collection of services.</font></span><br /></p></div></div></foreignObject><text x="136" y="71" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2538.5,4123.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="115" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 116px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Wages</font></h1><p><font color="#ffffff" style="font-size: 13px">We spend relatively less money on wages than our competitors because our service is highly automated.</font></p></div></div></foreignObject><text x="136" y="64" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2898.5,3406.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="282" height="213" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 245px; max-width: 282px; width: 282px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 110%"></p><h1><font color="#ffffff" style="font-size: 36px">Configuration</font></h1><p><font color="#ffffff"><span style="font-size: 30px">Customer Needs</span></font></p><p><font style="font-size: 14px"><font color="#ffffff">We generate extra sales by adding extra products</font><span style="color: rgb(255 , 255 , 255)">that our customers will love. We have an extremely</span><span style="color: rgb(255 , 255 , 255)">focused customer segment, and introduce extra</span><span style="color: rgb(255 , 255 , 255)">products to our range, if it fits the needs of our</span><span style="color: rgb(255 , 255 , 255)">customers.</span></font></p><p></p></div></div></foreignObject><text x="141" y="113" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2898.5,3666.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="134" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 162px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 120%"></p><h1><font color="#ffffff">Loyalty Programs</font></h1><p><font style="font-size: 14px"><font color="#ffffff">We try to keep our customers through loyalty</font><span style="color: rgb(255 , 255 , 255)">programs, where customers are rewarded for</span><span style="color: rgb(255 , 255 , 255)">remaining loyal customers. Loyal customers get</span><span style="color: rgb(255 , 255 , 255)">special benefits.</span></font></p><p></p></div></div></foreignObject><text x="136" y="73" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2898.5,3855.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="134" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Initial Price Reductions</font></h1><p><font style="font-size: 14px"><font color="#ffffff">We acquire new customers by luring them with low</font><span style="color: rgb(255 , 255 , 255)">introductory prices, giveaways or massive product</span><span style="color: rgb(255 , 255 , 255)">subsidies. We make our profits when they buy</span><span style="color: rgb(255 , 255 , 255)">next time.</span></font></p></div></div></foreignObject><text x="136" y="73" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(2898.5,4009.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="318" height="197" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 245px; max-width: 318px; width: 318px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 110%"></p><h1><font color="#ffffff" style="font-size: 36px">Market Channels</font></h1><p><span style="color: rgb(255 , 255 , 255)"><span style="font-size: 30px">Direct Contact</span></span></p><p><span><font color="#ffffff" style="font-size: 14px">We use direct contact as our primary market channel as our focus is to get negotiations with other businesses that can use our products and services.</font></span><br /></p></div></div></foreignObject><text x="159" y="105" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(87.5,901.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="840" height="129" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 138px; max-width: 840px; width: 840px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font style="font-weight: normal ; font-size: 28px" color="#ffffff">The aim of this project is to charge a drone from the power lines, so it doesn't have to return to a station, allowing for longer travel distances.</font></h1></div></div></foreignObject><text x="420" y="71" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">&lt;h1&gt;&lt;font style="font-weight: normal ; font-size: 28px" color="#ffffff"&gt;The aim of this project is to charge a drone from the power lines, so it doesn't have to return to a station, allowing for longer travel distances.&lt;/font&gt;&lt;/h1&gt;</text></switch></g><g transform="translate(86.5,1054.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="858" height="96" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 96px; max-width: 858px; width: 858px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff" style="font-weight: normal ; font-size: 29px">There is atradeoff between the weight of the drone and charging time.</font></h1><p><br /></p></div></div></foreignObject><text x="429" y="54" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">&lt;h1&gt;&lt;font color="#ffffff" style="font-weight: normal ; font-size: 29px"&gt;There is a&amp;nbsp;tradeoff between the weight of the drone and charging time.&amp;nbsp;&lt;/font&gt;&lt;/h1&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;</text></switch></g><g transform="translate(138.5,3206.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="977" height="187" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; white-space: nowrap;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><ul><li><font style="font-size: 28px">Thedrone needs to charge from the high-voltage power lines.</font></li><li><font style="font-size: 28px">There must not be any additional infrastructure.</font></li><li><font style="font-size: 28px">Everything necessary to charge the drone must be carried by thethe drone.</font></li><li><font style="font-size: 28px">The charging device must be able to fitaroundregular high-voltage cable.</font></li><li><font style="font-size: 28px">Ratio between charging time and working time must be at least 1:10.</font><br /></li></ul></div></div></foreignObject><text x="489" y="100" fill="#FFFFFF" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(138.5,3466.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="664" height="197" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 214px; max-width: 762px; width: 665px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><font style="font-size: 36px"><b>Challenges</b></font><br /><ul><li><font style="font-size: 28px">Is it possible to charge?</font></li><li><font style="font-size: 28px">Weightof charging circuit vs. charging time.</font></li><li><font style="font-size: 28px">Dimensioning and weight of the drone and battery.</font></li><li><font style="font-size: 28px">Varying currents and voltages in different cables.</font><br /></li></ul></div></div></foreignObject><text x="332" y="105" fill="#FFFFFF" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(124.5,4339.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="312" height="84" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; width: 314px; white-space: nowrap; word-wrap: normal; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><font style="font-size: 36px"><font color="#ffffff">Frederik Snedevind<br />Electronics</font><br /></font></div></div></foreignObject><text x="156" y="48" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">&lt;font style="font-size: 36px"&gt;&lt;font color="#ffffff"&gt;Frederik Snedevind&lt;br&gt;Electronics&lt;/font&gt;&lt;br&gt;&lt;/font&gt;</text></switch></g><g transform="translate(1321.5,4339.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="284" height="84" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; white-space: nowrap; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><div align="center"><font color="#ffffff"><font style="font-siz :inherit;text-decoration:inherit;"><div style="text-align: left"><h1><font color="#ffffff" style="font-size: 35px">2. Wired charging</font></h1><div><font color="#ffffff"><br /></font></div></div><div style="text-align: left"><span style="font-size: 35px"><u>Pros</u></span></div><ul><li style="text-align: left"><font style="font-size: 28px">Easy to calculate/model</font></li><li style="text-align: left"><font style="font-size: 28px">Easy to prototype</font></li><li style="text-align: left"><font style="font-size: 28px">Drone can stop the rotors while charging</font></li><li style="text-align: left"><font style="font-size: 28px">Effective compared to wireless charging</font></li></ul></div></div></foreignObject><text x="272" y="148" fill="#FFFFFF" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(86.5,1188.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="861" height="316" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; width: 863px; white-space: nowrap; word-wrap: normal; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><div style="text-align: left"><h1><font color="#ffffff" style="font-size: 41px">Possible solutions:</font></h1><h1><font color="#ffffff" style="font-size: 35px">1. Wireless charging</font></h1><div><font color="#ffffff"><br /></font></div></div><div style="text-align: left"><span style="font-size: 35px"><u>Pros</u></span></div><ul><li style="text-align: left"><font style="font-size: 28px">Doesn't have to stop for charging</font></li><li style="text-align: left"><font style="font-size: 28px">Doesn't have to be precise to maintain an electronic connection</font> tp://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 150px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; white-space: nowrap; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h5><font color="#ffffff">Powerline charging</font></h5></div></div></foreignObject><text x="574" y="357" fill="#FFFFFF" text-anchor="middle" font-size="150px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(3375.5,398.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="990" height="349" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 29px; font-family: Helvetica; color: rgb(51, 255, 51); line-height: 1.2; vertical-align: top; white-space: nowrap;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1 style="color: rgb(255 , 255 , 255) ; font-family: &quot;helvetica&quot; ; font-style: normal ; letter-spacing: normal ; text-align: left ; text-indent: 0px ; text-transform: none ; white-space: normal ; word-spacing: 0px">Problem definition</h1><div><font style="font-size: 14px"><font color="#ffffff">Drones inspecting HV-wires cannot fly for a long time</font><span style="color: rgb(255 , 255 , 255)">due to the battery limitations.</span></font></div><div><font style="font-size: 14px"><font color="#ffffff">Carrying a heavy</font><span style="color: rgb(255 , 255 , 255)">battery increases the total weight of the drone,</span></font></div><div><font color="#ffffff" size="3">which makes analternative solution to this problem interesting.</font></div><div><span style="color: rgb(255 , 255 , 255) ; font-size: medium">The aim of this project is to charge a drone from the power lines, so it doesn't have to return to a station, allowing for longer travel distances.</span></div><div><span style="color: rgb(255 , 255 , 255) ; font-size: medium">There is atradeoff between the weight of the drone and charging time.</span></div><div><font color="#ffffff"><br /></font></div></div></div></foreignObject><text x="495" y="189" fill="#33FF33" text-anchor="middle" font-size="29px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><image x="5005.5" y="1017.5" width="520" height="368" xlink:href="data:image/svg+xml;base64,PHN2ZyB4bWxuczpkYz0iaHR0cDovL3B1cmwub3JnL2RjL2VsZW1lbnRzLzEuMS8iIHhtbG5zOmNjPSJodHRwOi8vY3JlYXRpdmVjb21tb25zLm9yZy9ucyMiIHhtbG5zOnJkZj0iaHR0cDovL3d3dy53My5vcmcvMTk5OS8wMi8yMi1yZGYtc3ludGF4LW5zIyIgeG1sbnM6c3ZnPSJodHRwOi8vd3d3LnczLm9yZy8yMDAwL3N2ZyIgeG1sbnM9Imh0dHA6Ly93d3cudzMub3JnLzIwMDAvc3ZnIiB4bWxuczpzb2RpcG9kaT0iaHR0cDovL3NvZGlwb2RpLnNvdXJjZWZvcmdlLm5ldC9EVEQvc29kaXBvZGktMC5kdGQiIHhtbG5zOmlua3NjYXBlPSJodHRwOi8vd3d3Lmlua3NjYXBlLm9yZy9uYW1lc3BhY2VzL2lua3NjYXBlIiB2ZXJzaW9uPSIxLjEiIGlkPSJzdmcyIiB2aWV3Qm94PSIwIDAgMjA0OCAxNDQ4IiBoZWlnaHQ9IjE0NDgiIHdpZHRoPSIyMDQ4IiBpbmtzY2FwZTp2ZXJzaW9uPSIwLjkxIHIxMzcyNSIgc29kaXBvZGk6ZG9jbmFtZT0icXVhZGNvcHRlcl9pY29uXzAzLnMuc3ZnIiBpbmtzY2FwZTpleHBvcnQtZmlsZW5hbWU9IlY6XEt1bnN0XEdyYWZpa1xDb21tb25zXEljb25zXGFlcmlhbFxxdWFkY29wdGVyX2ljb25fMDMucy5wbmciIGlua3NjYXBlOmV4cG9ydC14ZHBpPSIxODAiIGlua3NjYXBlOmV4cG9ydC15ZHBpPSIxODAiPiYjeGE7ICA8c29kaXBvZGk6bmFtZWR2aWV3IHBhZ2Vjb2xvcj0iI2ZmZmZmZiIgYm9yZGVyY29sb3I9IiM2NjY2NjYiIGJvcmRlcm9wYWNpdHk9IjEiIG9iamVjdHRvbGVyYW5jZT0iMTAiIGdyaWR0b2xlcmFuY2U9IjEwIiBndWlkZXRvbGVyYW5jZT0iMTAiIGlua3NjYXBlOnBhZ2VvcGFjaXR5PSIwIiBpbmtzY2FwZTpwYWdlc2hhZG93PSIyIiBpbmtzY2FwZTp3aW5kb3ctd2lkdGg9IjY0MCIgaW5rc2NhcGU6d2luZG93LWhlaWdodD0iNDgwIiBpZD0ibmFtZWR2aWV3NyIgc2hvd2dyaWQ9ImZhbHNlIiBpbmtzY2FwZTp6b29tPSIwLjIzMDQ2ODc1IiBpbmtzY2FwZTpjeD0iMTA4NS4zMjc3IiBpbmtzY2FwZTpjeT0iODg0LjAzMzk4IiBpbmtzY2FwZTpjdXJyZW50LWxheWVyPSJzdmcyIi8+JiN4YTsgIDxkZWZzIGlkPSJkZWZzNCIvPiYjeGE7ICA8bWV0YWRhdGEgaWQ9Im1ldGFkYXRhNyI+JiN4YTsgICAgPHJkZjpSREY+JiN4Y ">Businessplan</font></b></div><span style="color: rgb(255 , 255 , 255)"><div style="text-align: left"><br /></div></span></div></div></foreignObject><text x="325" y="72" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">&lt;div style="text-align: left"&gt;&lt;b style="color: rgb(255 , 255 , 255)"&gt;&lt;font style="font-size: 100px"&gt;Businessplan&lt;/font&gt;&lt;/b&gt;&lt;/div&gt;&lt;span style="color: rgb(255 , 255 , 255)"&gt;&lt;div style="text-align: left"&gt;&lt;br&gt;&lt;/div&gt;&lt;/span&gt;</text></switch></g><g transform="translate(5072.5,3528.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="282" height="229" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 282px; width: 282px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 100%"></p><h1><font color="#ffffff" style="font-size: 36px">Product</font></h1><p><font color="#ffffff" style="font-size: 30px">Innovative Imitation</font></p><p style="text-align: left"><font style="font-size: 14px"><font color="#ffffff">We create value by adding innovative elements to our product/service compared to existing products/services. The customers perceive our offering as being more innovative and having something extra that delivers added value</font><span style="color: rgb(255 , 255 , 255) ; text-align: justify">.</span></font></p><p></p></div></div></foreignObject><text x="141" y="121" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5072.5,3778.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="134" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 138px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Market</font></h1><p><font color="#ffffff" style="font-size: 14px">We deliver our product/service at market price. The customers will perceive our price as neither high now low, but close to the normal level in the market.</font></p></div></div></foreignObject><text x="136" y="73" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5072.5,3927.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="118" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 150px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Productivity</font></h1><p><font color="#ffffff" style="font-size: 14px">We improve our customers' productivity. By using our product/service our customers can do certain things more efficiently.</font></p></div></div></foreignObject><text x="136" y="65" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5072.5,4088.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="134" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 137px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Value Use</font></h1><p><font color="#ffffff"><font style="font-size: 14px">The most important customer value is created when using the product/service. Our value creation is focused on the actual use of the product or service.</font><br /></font></p></div></div></foreignObject><text x="136" y="73" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5461.5,3387.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="282" height="229" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 282px; width: 282px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 100%"></p><h1><font color="#ffffff" style="font-size: 36px">Configuration</font></h1><p><font color="#ffffff" style="font-size: 30px">Innovation</font></p><p><font color="#ffffff" style="font-size: 14px">Our most important capability is being innovative. We are able to develop highly innovative products and services because of our highly skilled staff, an innovative business culture and all the necessary technology.</font></p><p></p></div></div></foreignObject><text x="141" y="121" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5461.5,3647.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="150" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 190px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 120%"></p><h1><font color="#ffffff">Value Chain</font></h1><p><font style="font-size: 14px"><font color="#ffffff">We are a trusted partner in a highly integrated</font><span style="color: rgb(255 , 255 , 255)">value chain. We focus on adding value in a very</span><span style="color: rgb(255 , 255 , 255)">specific part of that value chain. The end-user may</span><span style="color: rgb(255 , 255 , 255)">never even hear about us.</span></font></p><p></p></div></div></foreignObject><text x="136" y="81" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5461.5,3831.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="198" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Value Network</font></h1><p><font style="font-size: 14px"><font color="#ffffff">We are the hosts or the link. 'Let us introduce you</font><span style="color: rgb(255 , 255 , 255)">to ...'. Our processes: 1. Network promotion and</span><span style="color: rgb(255 , 255 , 255)">contacts with members 2. Service provisioning -</span><span style="color: rgb(255 , 255 , 255)">establishing, maintaining and terminating links</span><span style="color: rgb(255 , 255 , 255)">between members 3. Network infrastructure - make</span><span style="color: rgb(255 , 255 , 255)">sure that network members communicate.</span></font></p></div></div></foreignObject><text x="136" y="105" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5823.5,3187.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="282" height="193" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 282px; width: 282px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 100%"></p><h1><font color="#ffffff" style="font-size: 36px">Financial</font></h1><p><font color="#ffffff" style="font-size: 30px">Bargaining</font></p><p><font style="font-size: 13px"><font color="#ffffff">Our prices are the result of individual negotiation</font><span style="color: rgb(255 , 255 , 255)">with each customer. The price is basically</span><span style="color: rgb(255 , 255 , 255)">dependent on our relationship with the buyer.</span></font></p></div></div></foreignObject><text x="141" y="103" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5823.5,3512.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="306" height="115" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 203px; max-width: 306px; width: 306px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Customer Characteristics</font></h1><p><font style="font-size: 13px"><font color="#ffffff">The prices depend on customer characteristics.</font><span style="color: rgb(255 , 255 , 255)">Some customers pay more than others. B</span><span style="color: rgb(255 , 255 , 255)">igger company = higher</span><span style="color: rgb(255 , 255 , 255)">price.</span></font></p></div></div></foreignObject><text x="153" y="64" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5823.5,3422.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="100" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 133px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Renting/Leasing</font></h1><p><font style="font-size: 13px"><font color="#ffffff">We rent or lease something to our customers for a</font><span style="color: rgb(255 , 255 , 255)">period of time, for which we charge a fee.</span></font></p></div></div></foreignObject><text x="136" y="56" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5823.5,3742.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="130" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 139px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Subscription</font></h1><p><span style="color: rgb(255 , 255 , 255)"><font style="font-size: 13px">People subscribe to out product/service. Over a certain period of time they get: 1. A fixed set of goods or services, or 2. Unlimited use of a service or collection of services.</font></span><br /></p></div></div></foreignObject><text x="136" y="71" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(5823.5,3924.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="115" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 116px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Wages</font></h1><p><font color="#ffffff" style="font-size: 13px">We spend relatively less money on wages than our competitors because our service is highly automated.</font></p></div></div></foreignObject><text x="136" y="64" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(6188.5,3537.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="282" height="245" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 245px; max-width: 282px; width: 282px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 110%"></p><h1><font color="#ffffff" style="font-size: 36px">Customer</font></h1><h1><font color="#ffffff" style="font-size: 36px">Configuration</font><span style="font-size: 36px ; color: rgb(255 , 255 , 255) ; font-weight: normal"></span></h1><p><font color="#ffffff"><span style="font-size: 30px">Customer Needs</span></font></p><p><font style="font-size: 14px"><font color="#ffffff">We generate extra sales by adding extra products</font><span style="color: rgb(255 , 255 , 255)">that our customers will love. We have an extremely</span><span style="color: rgb(255 , 255 , 255)">focused customer segment, and introduce extra</span><span style="color: rgb(255 , 255 , 255)">products to our range, if it fits the needs of our</span><span style="color: rgb(255 , 255 , 255)">customers.</span></font></p><p></p></div></div></foreignObject><text x="141" y="129" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(6193.5,3830.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="134" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 162px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 120%"></p><h1><font color="#ffffff">Loyalty Programs</font></h1><p><font style="font-size: 14px"><font color="#ffffff">We try to keep our customers through loyalty</font><span style="color: rgb(255 , 255 , 255)">programs, where customers are rewarded for</span><span style="color: rgb(255 , 255 , 255)">remaining loyal customers. Loyal customers get</span><span style="color: rgb(255 , 255 , 255)">special benefits.</span></font></p><p></p></div></div></foreignObject><text x="136" y="73" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(6188.5,4030.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="272" height="134" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 250px; max-width: 272px; width: 272px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><font color="#ffffff">Initial Price Reductions</font></h1><p><font style="font-size: 14px"><font color="#ffffff">We acquire new customers by luring them with low</font><span style="color: rgb(255 , 255 , 255)">introductory prices, giveaways or massive product</span><span style="color: rgb(255 , 255 , 255)">subsidies. We make our profits when they buy</span><span style="color: rgb(255 , 255 , 255)">next time.</span></font></p></div></div></foreignObject><text x="136" y="73" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(6185.5,3187.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="318" height="197" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 245px; max-width: 318px; width: 318px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 110%"></p><h1><font color="#ffffff" style="font-size: 36px">Market Channels</font></h1><p><span style="color: rgb(255 , 255 , 255)"><span style="font-size: 30px">Direct Contact</span></span></p><p><span><font color="#ffffff" style="font-size: 14px">We use direct contact as our primary market channel as our focus is to get negotiations with other businesses that can use our products and services.</font></span><br /></p></div></div></foreignObject><text x="159" y="105" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(3371.5,1053.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="1" height="58" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 96px; max-width: 858px; width: 1px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><h1><br /></h1></div></div></foreignObject><text x="0" y="35" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">&lt;h1&gt;&lt;br&gt;&lt;/h1&gt;</text></switch></g><g transform="translate(3385.5,3204.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="642" height="127" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; white-space: nowrap;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><ul><li><font style="font-size: 18px">Thedrone needs to charge from the high-voltage power lines.</font></li><li><font style="font-size: 18px">There most not be any additional infrastructure.</font></li><li><font style="font-size: 18px">Everything necessary to charge the drone must be carried by thethe drone.</font></li><li><font style="font-size: 18px">The charging device must be able to fitaroundregular high-voltage cable.</font></li><li><font style="font-size: 18px">Ratio between charging time and working time must be at least 1:10.</font><br /></li></ul></div></div></foreignObject><text x="321" y="70" fill="#FFFFFF" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(3398.5,3404.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="441" height="149" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; overflow: hidden; max-height: 184px; max-width: 750px; width: 442px; white-space: normal; word-wrap: normal;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><font style="font-size: 36px"><b>Challenges</b></font><br /><ul><li><font style="font-size: 18px">Is it possible to charge?</font></li><li><font style="font-size: 18px">Weightof charging circuit vs. charging time.</font></li><li><font style="font-size: 18px">Dimensioning and weight of the drone and battery.</font></li><li><font style="font-size: 18px">Varying currents and voltages in different cables.</font><br /></li></ul></div></div></foreignObject><text x="221" y="81" fill="#FFFFFF" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(3409.5,4338.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="312" height="84" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; width: 314px; white-space: nowrap; word-wrap: normal; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><font style="font-size: 36px"><font color="#ffffff">Frederik Snedevind<br />Electronics</font><br /></font></div></div></foreignObject><text x="156" y="48" fill="#000000" text-anchor="middle" font-size="12px" font-family="Helvetica">&lt;font style="font-size: 36px"&gt;&lt;font color="#ffffff"&gt;Frederik Snedevind&lt;br&gt;Electronics&lt;/font&gt;&lt;br&gt;&lt;/font&gt;</text></switch></g><g transform="translate(4606.5,4338.5)"><switch><foreignObject style="overflow:visible;" pointer-events="a visible;" pointer-events="all" width="543" height="284" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; width: 543px; white-space: nowrap; word-wrap: normal; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><div style="text-align: left"><h1><font color="#ffffff" style="font-size: 35px">2. Wired charging</font></h1><div><font color="#ffffff"><br /></font></div></div><div style="text-align: left"><span style="font-size: 35px"><u>Pros</u></span></div><ul><li style="text-align: left"><font style="font-size: 28px">Easy to calculate/model</font></li><li style="text-align: left"><font style="font-size: 28px">Easy to prototype</font></li><li style="text-align: left"><font style="font-size: 28px">Drone can stop the rotors while charging</font></li><li style="text-align: left"><font style="font-size: 28px">Effective compared to wireless charging</font></li></ul></div></div></foreignObject><text x="272" y="148" fill="#FFFFFF" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(3371.5,1267.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="861" height="316" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; width: 863px; white-space: nowrap; word-wrap: normal; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><div style="text-align: left"><h1><font color="#ffffff" style="font-size: 41px">Possible solutions:</font></h1><h1><font color="#ffffff" style="font-size: 35px">1. Wireless charging</font></h1><div><font color="#ffffff"><br /></font></div></div><div style="text-align: left"><span style="font-size: 35px"><u>Pros</u></span></div><ul><li style="text-align: left"><font style="font-size: 28px">Doesn't have to stop for charging</font></li><li style="text-align: left"><font style="font-size: 28px">Doesn't have to be precise to maintain an electronic connection</font></li><li style="text-align: left"><font style="font-size: 28px">Can use the power lines as a highway while continuously charging</font></li></ul></div></div></foreignObject><text x="431" y="164" fill="#FFFFFF" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><g transform="translate(3402.5,1593.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="257" height="130" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 12px; font-family: Helvetica; color: rgb(255, 255, 255); line-height: 1.2; vertical-align: top; width: 257px; white-space: nowrap; word-wrap: normal; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><div style="text-align: left"><u><font style="font-size: 35px">Cons</font></u></div><ul><li style="text-align: left"><span style="font-size: 28px">Ineffective</span></li><li style="text-align: left"><span style="font-size: 28px">Hard to prototype</span></li></ul></div></div></foreignObject><text x="129" y="71" fill="#FFFFFF" text-anchor="middle" font-size="12px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><image x="5944.5" y="4472.5" width="623" height="166" xlink:href="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAz4AAAD6CAYAAABgWpLnAAAdlUlEQVR42u3d65XbuLaFUYTQITAEhaAQFAJDYAgKQSEwBIXAEBQCM6lTPMWy5XLZ1ovkBjC/MfTjjtO33
